import React from 'react'

export default function Confidentialite() {
  return (
    <div>
        <h1>Conditions générales d'utilisation</h1>
        <p>Notre site met à votre disposition un forum sur lequel vous pouvez créer des posts sur des sujets en lien avec le poker. Vous pourrez également créer des messages sur des posts qui vous intéressent. </p>
    </div>
  )
}
